/* eslint-disable react/no-unescaped-entities */
/* eslint-disable react/jsx-props-no-spreading */
import React from 'react';
import { Route, Switch } from 'react-router-dom';
import LandingPage from './components/LandingPage';
import SignUpPage from './components/SignUpPage';
import DetailsPage from './components/DetailsPage';
import Favorites from './components/Favorites';
import MessagesPage from './components/MessagesPage';
import SearchPage from './components/SearchPage';
import Page from './components/Page';
import List from './components/List';
import Detail from './components/Detail';

const App = () => {
  return (
    <Switch>
      <Route exact path="/list/" render={() => <Page condition={true}><List /></Page>} />
      <Route exact path="/details/:id" render={() => <Page condition={true}><Detail /></Page>} />
      <Route exact path="/search/:term" component={SearchPage} />
      <Route exact path="/favorites" render={() => <Page condition={true}><Favorites /></Page>} />
      <Route exact path="/messages" component={MessagesPage} />
      <Route exact path="/sign_up/" render={() => <SignUpPage {...{ type: 'UP' }} />} />
      <Route exact path="/sign_in/" render={() => <SignUpPage {...{ type: 'IN' }} />} />
      <Route path="/" component={LandingPage} />
      <Route path="/temp-chat" component={ConversationsList} />
    </Switch>
  )
};

export default App;
